  true,\n\t\"url\": null,\n\t\"notes\": \"The Oak Ridge National Laboratory (ORNL)
  National Hydropower Asset Assessment Program (NHAAP) is an integrated energy, water,
  and ecosystem research and geospatial data integration effort for efficient, sustainable,
  and environmentally friendly hydroelectricity generation and water management. Our
  partners include state and federal agencies, non-governmental organizations, technology
  and resource developers, utilities, and researchers. ORNL is managed by UT-Battelle,
  LLC, for the U.S. Department of Energy (DOE).  NHAAP is sponsored by the DOE Office
  of Energy Efficiency and Renewable Energy (EERE).\",\n\t\"license_title\": \"Creative
